import React from 'react';
import GameCard from '../components/GameCard';

const TopUp = () => {
  return (
    <div>
      <h1>Selamat Datang di Top-Up Game Shop</h1>
      <div>
        <GameCard gameName="Valorant" imageUrl="url_to_valorant_image" linkTo="/topup/valorant" />
        {/* Tambahkan kartu game lain di sini */}
      </div>
    </div>
  );
};

export default TopUp;
